      .then(res => res.json())
      .then(data => setProfile(data))
  },[])

  console.log(profile)

  return (
    <div>
      <button>Cacher les donn√©es</button>
      {
        profile.map(data => (
          <Contenu 
            data={data}
          />
        ))
      }
    </div>
  );
}

export default App;
